CREATE DEFINER=`david`@`91.102.85.132` PROCEDURE `spUpdateCountry`(
	IN paramName varchar(50),
	IN paramIso varchar(10),
	IN paramReferenceAddress1 varchar(50),
	IN paramReferenceAddress2 varchar(50),
	IN paramReferenceCity varchar(50),
	IN paramReferenceState varchar(50),
	IN paramReferencePostcode varchar(20),
	IN paramWorkflow int
	
	
	)
    COMMENT 'Create a record in countries (if does not already exist)'
beginProcedure: BEGIN
/** 
	Created: 2020-05-01
	
	Strategy:
		check if country iso code already exists, only update if already exists 
**/
	DECLARE oName  VARCHAR(50) DEFAULT '';
	DECLARE oIso  VARCHAR(10) DEFAULT '';
	DECLARE oReferenceAddress1  VARCHAR(50) DEFAULT '';
	DECLARE oReferenceAddress2  VARCHAR(50) DEFAULT '';
	DECLARE oReferenceCity  VARCHAR(50) DEFAULT '';
	DECLARE oReferenceState  VARCHAR(50) DEFAULT '';
	DECLARE oReferencePostcode  VARCHAR(20) DEFAULT '';
	DECLARE oWorkflow  int DEFAULT 1;
	


	validation: BEGIN
		IF length(paramName) < 2 THEN
			leave beginProcedure;
		END IF;
		IF length(paramIso) < 2 THEN
			leave beginProcedure;
		END IF;
		
		SET oName:=paramName;
		SET oIso:=paramIso;
		SET oReferenceAddress1:=paramReferenceAddress1;
		SET oReferenceAddress2:=paramReferenceAddress2;
		SET oReferenceCity:=paramReferenceCity;
		SET oReferenceState:=paramReferenceState;
		SET oReferencePostcode:=paramReferencePostcode;
		SET oWorkflow:=paramWorkflow;
	END validation;
	
	
	
	
	SELECT @counter:=count(*) from countries WHERE iso=oIso;
	IF @counter=0 THEN
		INSERT INTO countries (`name`, `iso`) 
		SELECT oName, oIso;
	END IF;
	
	-- end with update to cover off occassions where we might update the email, prefix or owner
	UPDATE countries SET 
		`name`=oName,
		`referenceAddress1`=oReferenceAddress1,
		`referenceAddress2`=oReferenceAddress2,
		`referenceCity`=oReferenceCity,
		`referenceState`=oReferenceState,
		`referencePostcode`=oReferencePostcode,
		`workflowStatus`=oWorkflow

		WHERE iso=oIso;
	
END ;;
